import React, { useEffect, useState } from 'react';
import api from '../services/api';

const TenantLeaseCard = ({ user, onLeaseLoaded }) => {
  const [lease, setLease] = useState(null);

  useEffect(() => {
    if (!user?.id) return;

    api.get(`/leases/user/${user.id}`)
      .then((res) => {
        const leaseData = res.data || null;
        setLease(leaseData);
        onLeaseLoaded?.(leaseData); // üî• Pass lease upward no matter what
        console.log('üì§ Lease passed to dashboard:', leaseData);
      })
      .catch((err) => {
        console.error("‚ùå Error loading lease:", err.response?.data || err.message);
        setLease(null);
        onLeaseLoaded?.(null); // üî• Still notify dashboard
      });
  }, [user]);

  if (!lease) return <p>Loading Lease...</p>;

  return (
    <div>
      <p><strong>Lease ID:</strong> {lease.lease_id || 'N/A'}</p>
      <p><strong>Property ID:</strong> {lease.property_id || 'N/A'}</p>
      <p><strong>Start:</strong> {lease.start_date ? new Date(lease.start_date).toLocaleDateString() : 'N/A'}</p>
      <p><strong>End:</strong> {lease.end_date ? new Date(lease.end_date).toLocaleDateString() : 'N/A'}</p>
      <p><strong>Rent:</strong> {lease.rent_amount !== undefined ? `$${lease.rent_amount}` : 'Not set'}</p>
    </div>
  );
};

export default TenantLeaseCard;
